import React from "react";
import "./libcont.css";
import "./weather.css";

function weather() {
  return (
    <>
      <div className="foodcontainer">

        <iframe
          src={"/weather/index.html"}
          name="iframe-music"
          style={{ top:'200pt', width: '100%', border: '0px', height: '100%' }}
        />
        <div style="top:'200pt', width: '100%', height: '10%'">
        <div class="wrapper">
          <div class="card">
            <div class="card__image">
              <img src="https://s3-us-west-2.amazonaws.com/s.cdpn.io/279756/lamp.png" alt="React Image"/>
            </div>
          </div>
        </div>

        </div>

      </div>
    </>
  );
}


export default weather;
